int main() {
    hls::stream<AXIS_INPUT> S_AXIS;
    hls::stream<AXIS_OUTPUT> M_AXIS;
    AXIS_INPUT write_input;
    AXIS_OUTPUT read_output;
    int test_output[TEST_CASES_NUMBER] = {};
    int correct_ans[TEST_CASES_NUMBER] = {};
    for (int i = 0; i < TEST_CASES_NUMBER; i++) {
        if (i < GRENADE_COUNT) {
            correct_ans[i] = 0;
        } else if (i < RELOAD_COUNT) {
            correct_ans[i] = 1;
        } else if (i < SHIELD_COUNT) {
            correct_ans[i] = 2;
        } else if (i < NOISE_COUNT) {
            correct_ans[i] = 3;
        } else {
            correct_ans[i] = 4;
        }
    }
    int idx = 0;
    for (int i = 0; i < TEST_CASES_NUMBER; i++) {
        //printf("Transmitting data for test case %d ... \r\n", i);
        for (int j = 0; j < INPUT_NODES; j++) {
            write_input.data = test_case[idx++];
            write_input.last = 0;
            if (j == INPUT_NODES - 1) {
                write_input.last = 1;
            }
            S_AXIS.write(write_input);
        }
        mlp(S_AXIS, M_AXIS);
        //printf("Receiving data for test case %d ... \r\n", i);
        read_output = M_AXIS.read();
        test_output[i] = read_output.data;
    }
    //printf("Comparing data ...\r\n");
    int count = 0;
    for (int i = 0; i < TEST_CASES_NUMBER; i++) {
        if (correct_ans[i] == test_output[i]) {
            count++;
        } else {
        	printf("True Label: %d | FPGA: %d ...", correct_ans[i], test_output[i]);
            printf("Test fails!\n");
        }
    }

    printf("Accuracy: %f %% (%d out of %d)\n", count / (float)TEST_CASES_NUMBER, count, TEST_CASES_NUMBER);
    if (count / (float)TEST_CASES_NUMBER > 0.9) {
    	return 0;
    }
    return 1; //indicate test fails
}
